import{_ as e,W as g,X as n,Y as a,Z as s,$ as t,a0 as r,D as o}from"./framework-0cf5f349.js";const c={},l=r('<h1 id="达梦数据库迁移工具dts" tabindex="-1"><a class="header-anchor" href="#达梦数据库迁移工具dts" aria-hidden="true">#</a> 达梦数据库迁移工具DTS</h1><h1 id="_1-具体操作" tabindex="-1"><a class="header-anchor" href="#_1-具体操作" aria-hidden="true">#</a> 1. 具体操作</h1><h3 id="_1-1-打开-dm-数据迁移工具-dts" tabindex="-1"><a class="header-anchor" href="#_1-1-打开-dm-数据迁移工具-dts" aria-hidden="true">#</a> 1.1 打开 DM 数据迁移工具 DTS</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095241281.png" alt="image-20210629095241281" tabindex="0" loading="lazy"><figcaption>image-20210629095241281</figcaption></figure><h3 id="_1-2-新建工程" tabindex="-1"><a class="header-anchor" href="#_1-2-新建工程" aria-hidden="true">#</a> 1.2 新建工程</h3><p>空白位置点击新建工程</p><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095346165.png" alt="image-20210629095346165" tabindex="0" loading="lazy"><figcaption>image-20210629095346165</figcaption></figure><h3 id="_1-3-输入工程名" tabindex="-1"><a class="header-anchor" href="#_1-3-输入工程名" aria-hidden="true">#</a> 1.3 输入工程名</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095437062.png" alt="image-20210629095437062" tabindex="0" loading="lazy"><figcaption>image-20210629095437062</figcaption></figure><h3 id="_1-4-新建迁移-创建迁移任务" tabindex="-1"><a class="header-anchor" href="#_1-4-新建迁移-创建迁移任务" aria-hidden="true">#</a> 1.4 新建迁移，创建迁移任务</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095728500.png" alt="image-20210629095728500" tabindex="0" loading="lazy"><figcaption>image-20210629095728500</figcaption></figure><h3 id="_1-5-输入迁移名称" tabindex="-1"><a class="header-anchor" href="#_1-5-输入迁移名称" aria-hidden="true">#</a> 1.5 输入迁移名称</h3><p>输入迁移名称，迁移名称可自定义，输入后点击确定。</p><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095821871.png" alt="image-20210629095821871" tabindex="0" loading="lazy"><figcaption>image-20210629095821871</figcaption></figure><h3 id="_1-6-迁移创建好后-会弹出迁移向导-如下图所示" tabindex="-1"><a class="header-anchor" href="#_1-6-迁移创建好后-会弹出迁移向导-如下图所示" aria-hidden="true">#</a> 1.6 迁移创建好后，会弹出迁移向导，如下图所示</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629095920224.png" alt="image-20210629095920224" tabindex="0" loading="lazy"><figcaption>image-20210629095920224</figcaption></figure><h3 id="_1-7-点击下一步-选择迁移类型-源端-目标端" tabindex="-1"><a class="header-anchor" href="#_1-7-点击下一步-选择迁移类型-源端-目标端" aria-hidden="true">#</a> 1.7 点击下一步，选择迁移类型（源端 ==&gt; 目标端）</h3><p>选择合适的数据库迁移类型</p><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629100058437.png" alt="image-20210629100058437" tabindex="0" loading="lazy"><figcaption>image-20210629100058437</figcaption></figure><h3 id="_1-8-输入源端连接信息" tabindex="-1"><a class="header-anchor" href="#_1-8-输入源端连接信息" aria-hidden="true">#</a> 1.8 输入源端连接信息</h3><ul><li>这里最好选择sysdba 角色的用户，否则加载表的时候会有异常</li></ul><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629144625735.png" alt="image-20210629144625735" tabindex="0" loading="lazy"><figcaption>image-20210629144625735</figcaption></figure><p>输入源端连接信息包括：主机 ip ，数据库监听端口，数据库实例名，源端数据库登录账号，源端数据库登录密码</p><p>以上信息确保输入正确后，点击下一步</p><h3 id="_1-9-输入目标端连接信息" tabindex="-1"><a class="header-anchor" href="#_1-9-输入目标端连接信息" aria-hidden="true">#</a> 1.9 输入目标端连接信息</h3><ul><li>这里的用户名最好自己新建，否则在查询的时候需要加上模式名（数据库名）</li></ul><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629111958489.png" alt="image-20210629111958489" tabindex="0" loading="lazy"><figcaption>image-20210629111958489</figcaption></figure><h3 id="_1-10-迁移方式-对象的选择" tabindex="-1"><a class="header-anchor" href="#_1-10-迁移方式-对象的选择" aria-hidden="true">#</a> 1.10 迁移方式 / 对象的选择</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629103553498.png" alt="image-20210629103553498" tabindex="0" loading="lazy"><figcaption>image-20210629103553498</figcaption></figure><p>可选择方式 1 （ sql 结果集），方式 2 （数据对象用户直接迁移）进行迁移；可通过输入“查找对象名”中输入源端需迁移用户名进行过滤，且可以通过手动修改“目的模式”设置目标端导入用户。</p><p>点击下一步继续。</p><h3 id="_1-11-选择迁移的表" tabindex="-1"><a class="header-anchor" href="#_1-11-选择迁移的表" aria-hidden="true">#</a> 1.11 选择迁移的表</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629111958489.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="_1-12-确认迁移信息-开始迁移" tabindex="-1"><a class="header-anchor" href="#_1-12-确认迁移信息-开始迁移" aria-hidden="true">#</a> 1.12 确认迁移信息，开始迁移</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629105203767.png" alt="image-20210629105203767" tabindex="0" loading="lazy"><figcaption>image-20210629105203767</figcaption></figure><h3 id="_1-13-检查迁移日志-无报错信息-即证明迁移完成。" tabindex="-1"><a class="header-anchor" href="#_1-13-检查迁移日志-无报错信息-即证明迁移完成。" aria-hidden="true">#</a> 1.13 检查迁移日志，无报错信息，即证明迁移完成。</h3><figure><img src="https://zszblog.oss-cn-beijing.aliyuncs.com/zszblog/blogimage-master/img/image-20210629105824615.png" alt="image-20210629105824615" tabindex="0" loading="lazy"><figcaption>image-20210629105824615</figcaption></figure><h2 id="参考文章" tabindex="-1"><a class="header-anchor" href="#参考文章" aria-hidden="true">#</a> 参考文章</h2>',38),d={href:"https://m.yisu.com/zixun/305021.html",target:"_blank",rel:"noopener noreferrer"};function h(m,b){const i=o("ExternalLinkIcon");return g(),n("div",null,[l,a("p",null,[a("a",d,[s("达梦数据库迁移工具DTS使用手册"),t(i)])])])}const f=e(c,[["render",h],["__file","dm-operation-dts.html.vue"]]);export{f as default};
